import React from "react";

import BannerH from "../assets/bannièreH.png";
import Cards from "../components/Cards";
import ListAccommodation from "../data/logements.json";
import { NavLink } from "react-router-dom";

function Home() {
  return (
    <div className="home">
      <div className="bannerH">
        <img src={BannerH} alt="image bannière" />
      </div>

      <div className="listAccommodation">
        {ListAccommodation.map((accommodation) => (
          <NavLink
            key={accommodation.id}
            to={"/accommodation/" + accommodation.id + "#"}
          >
            <Cards
              key={accommodation.id}
              id={accommodation.id}
              image={accommodation.cover}
              title={accommodation.title}
            />
          </NavLink>
        ))}
      </div>
    </div>
  );
}

export default Home;
